import { FormControl, FormControlLabel, FormLabel, Radio, RadioGroup } from '@material-ui/core';
import React from 'react';

const RadioButton = ({name,value,onChange}) => {
    console.log(name,value)
    return ( 

      <FormControl component="fieldset">
      <FormLabel component="legend">Gender</FormLabel>
      <RadioGroup aria-label="gender" name="gender1" value={value} onChange={onChange}>
      <FormControlLabel value="1" style={{color:"red"}}  control={<Radio  color="default"/>} label="1" />
          <FormControlLabel value="2" style={{color:"red"}}  control={<Radio  color="default"/>} label="2" />
          <FormControlLabel value="3"  style={{color:"red"}} control={<Radio color="default" />} label="3" />

      </RadioGroup>
    </FormControl>
     );
}

export default RadioButton;
